import React from "react";

const dataObat:React.FC = () => {
  return (
    <div>
      <table>
        <tr>
          <th>id</th>
          <th>nama</th>
          <th>jumlah</th>
          <th>harga</th>
        </tr>
      </table>
    </div>
  )
}

export default dataObat;
